const TabCategory = () => {
  return (
    <div>
      <ul className="tab">
        <li className="active">Men</li>
        <li>Women</li>
      </ul>
      <style>
        {`

        .tab {
            display: flex;
            align-items: center;
        }

        .tab li {
            padding: 0 5rem;
        }

            `}
      </style>
    </div>
  );
};

export default TabCategory;
